INSERT INTO `Item` VALUES (1,'Master Ball','\"The best Poké Ball with the ultimate level of performance. With it'),(2,'Ultra Ball','An ultra-high-performance Poké Ball that provides a higher success rate for catching Pokémon than a Great Ball.\r'),(3,'Great Ball','\"A good'),(4,'Poké Ball','\"A device for catching wild Pokémon. It’s thrown like a ball at a Pokémon'),(5,'Safari Ball','A special Poké Ball that is used only in the Great Marsh. It is recognizable by the camouflage pattern decorating it.\r'),(6,'Net Ball','A somewhat different Poké Ball that is more effective when attempting to catch Water- or Bug-type Pokémon.\r'),(7,'Dive Ball','A somewhat different Poké Ball that works especially well when catching Pokémon that live underwater.\r'),(8,'Nest Ball','A somewhat different Poké Ball that becomes more effective the lower the level of the wild Pokémon.\r'),(9,'Repeat Ball','A somewhat different Poké Ball that works especially well on a Pokémon species that has been caught before.\r'),(10,'Timer Ball','A somewhat different Poké Ball that becomes progressively more effective the more turns that are taken in battle.\r'),(11,'Luxury Ball','A particularly comfortable Poké Ball that makes a wild Pokémon quickly grow friendlier after being caught.\r'),(12,'Premier Ball','A somewhat rare Poké Ball that was made as a commemorative item used to celebrate an event of some sort.\r'),(13,'Dusk Ball','A somewhat different Poké Ball that makes it easier to catch wild Pokémon at night or in dark places like caves.\r'),(14,'Heal Ball','A remedial Poké Ball that restores the HP of a Pokémon caught with it and eliminates any status conditions.\r'),(15,'Quick Ball','A somewhat different Poké Ball that has a more successful catch rate if used at the start of a wild encounter.\r'),(16,'Cherish Ball','A quite rare Poké Ball that has been crafted in order to commemorate a special occasion of some sort.\r'),(17,'Potion','A spray-type medicine for treating wounds. It can be used to restore 20 HP to an injured Pokémon.\r'),(18,'Antidote','A spray-type medicine for poisoning. It can be used once to lift the effects of being poisoned from a Pokémon.\r'),(19,'Burn Heal','A spray-type medicine for treating burns. It can be used once to heal a Pokémon suffering from a burn.\r'),(20,'Ice Heal','A spray-type medicine for freezing. It can be used once to defrost a Pokémon that has been frozen solid.\r'),(21,'Awakening','A spray-type medicine used against sleep. It can be used once to rouse a Pokémon from the clutches of sleep.\r'),(22,'Paralyze Heal','A spray-type medicine for paralysis. It can be used once to free a Pokémon that has been paralyzed.\r'),(23,'Full Restore','A medicine that can be used to fully restore the HP of a single Pokémon and heal any status conditions it has.\r'),(24,'Max Potion','A spray-type medicine for treating wounds. It will completely restore the max HP of a single Pokémon.\r'),(25,'Hyper Potion','A spray-type medicine for treating wounds. It can be used to restore 120 HP to an injured Pokémon.\r'),(26,'Super Potion','A spray-type medicine for treating wounds. It can be used to restore 60 HP to an injured Pokémon.\r'),(27,'Full Heal','A spray-type medicine that is broadly effective. It can be used once to heal all the status conditions of a Pokémon.\r'),(28,'Revive','A medicine that can revive fainted Pokémon. It also restores half of a fainted Pokémon’s maximum HP.\r'),(29,'Max Revive','A medicine that can revive fainted Pokémon. It also fully restores a fainted Pokémon’s maximum HP.\r'),(30,'Fresh Water','\"Water with a high mineral content. When consumed'),(31,'Soda Pop','\"A highly carbonated soda drink. When consumed'),(32,'Lemonade','\"A very sweet and refreshing drink. When consumed'),(33,'Moomoo Milk','\"A bottle of highly nutritious milk. When consumed'),(34,'Energy Powder','\"A very bitter medicinal powder. When consumed'),(35,'Energy Root','\"An extremely bitter medicinal root. When consumed'),(36,'Heal Powder','