erializes an odd psychic wave to attack the target. This attack does physical damage.\r'),(331,'TM04','The user quietly focuses its mind and calms its spirit to raise its Sp. Atk and Sp. Def stats.\r'),(332,'TM05','\"The target is scared off'),(333,'TM06','A move that leaves the target badly poisoned. Its poison damage worsens every turn.\r'),(334,'TM07','The user summons a hailstorm lasting five turns. It damages all Pokémon except the Ice type.\r'),(335,'TM08','\"The user tenses its muscles to bulk up its body'),(336,'TM09','The user drenches the target in a special poisonous liquid. This move’s power is doubled if the target is poisoned.\r'),(337,'TM10','A unique attack that varies in type depending on the Pokémon using it.\r'),(338,'TM11','\"The user intensifies the sun for five turns'),(339,'TM12','The target is taunted into a rage that allows it to use only attack moves for three turns.\r'),(340,'TM13','The target is struck with an icy-cold beam of energy. This may also leave the target frozen.\r'),(341,'TM14','A howling blizzard is summoned to strike opposing Pokémon. This may also leave the opposing Pokémon frozen.\r'),(342,'TM15','The target is attacked with a powerful beam. The user can’t move on the next turn.\r'),(343,'TM16','A wondrous wall of light is put up to reduce damage from special attacks for five turns.\r'),(344,'TM17','Enables the user to evade all attacks. Its chance of failing rises if it is used in succession.\r'),(345,'TM18','\"The user summons a heavy rain that falls for five turns'),(346,'TM19','The user lands and rests its body. It restores the user’s HP by up to half of its max HP.\r'),(347,'TM20','The user creates a protective field that prevents status conditions for five turns.\r'),(348,'TM21','This full-power attack grows more powerful the less the user likes its Trainer.\r'),(349,'TM22','\"In this two-turn attack'),(350,'TM23','The user throws a stone or similar projectile to attack an opponent. A flying Pokémon will fall to the g