ully restores the user’s HP and heals any status conditions.\r'),(372,'TM45','\"If it is the opposite gender of the user'),(373,'TM46','The user attacks and steals the target’s held item simultaneously. The user can’t steal anything if it already holds an item.\r'),(374,'TM47','\"The user makes a swift attack on the target’s legs'),(375,'TM48','The user attacks the target with a song. Others can join in the Round to increase the power of the attack.\r'),(376,'TM49','\"The user attacks the target with an echoing voice. If this move is used every turn'),(377,'TM50','The user attacks the target at full power. The attack’s recoil harshly lowers the user’s Sp. Atk stat.\r'),(378,'TM51','The target is hit with wings of steel. This may also raise the user’s Defense stat.\r'),(379,'TM52','The user heightens its mental focus and unleashes its power. This may also lower the target’s Sp. Def.\r'),(380,'TM53','The user draws power from nature and fires it at the target. This may also lower the target’s Sp. Def.\r'),(381,'TM54','A restrained attack that prevents the target from fainting. The target is left with at least 1 HP.\r'),(382,'TM55','The user shoots boiling hot water at its target. This may also leave the target with a burn.\r'),(383,'TM56','The user flings its held item at the target to attack. This move’s power and effects depend on the item.\r'),(384,'TM57','The user attacks with an electric charge. The user may use any remaining electricity to raise its Sp. Atk stat.\r'),(385,'TM58','\"The user takes the target into the sky'),(386,'TM59','The user swings its body around violently to inflict damage on everything in its vicinity.\r'),(387,'TM60','The user suppresses the target and makes its move go last.\r'),(388,'TM61','\"The user shoots a sinister'),(389,'TM62','\"The user nimbly strikes the target. If the user is not holding an item'),(390,'TM63','This move prevents the target from using its held item for five turns. Its Trainer is also prevented from using items on it.\r'),(391,'TM64','The user attacks everything around it by causing a tremendous explosion. The user faints upon using this move.\r'),(392,'TM65','The user slashes with a sharp claw made from shadows. Critical hits land more easily.\r'),(393,'TM66','\"The user stores power'),(394,'TM67','The user stabs the target with a sharp horn. The attack never misses.\r'),(395,'TM68','The user charges at the target using every bit of its power. The user can’t move on the next turn.\r'),(396,'TM69','The user polishes its body to reduce drag. This can sharply raise the Speed stat.\r'),(397,'TM70','This move reduces damage from physical and special moves for five turns. This can be used only in a hailstorm.\r'),(398,'TM71','The user stabs the target from below with sharpened stones. Critical hits land more easily.\r'),(399,'TM72','\"After making its attack'),(400,'TM73','The user launches a weak jolt of electricity that paralyzes the target.\r'),(401,'TM74','\"The user tackles the target with a high-speed spin. The slower the user compared to the target'),(402,'TM75','A frenetic dance to uplift the fighting spirit. This sharply raises the user’s Attack stat.\r'),(403,'TM76','The user soars and then strikes its target on the next turn.\r'),(404,'TM77','The user hypnotizes itself into copying any stat change made by the target.\r'),(405,'TM78','The user strikes everything around it by stomping down on the ground. This lowers the Speed stat of those hit.\r'),(406,'TM79','The user blows its cold breath on the target. This attack always results in a critical hit.\r'),(407,'TM80','Large boulders are hurled at the opposing Pokémon to inflict damage. This may also make the opposing Pokémon flinch.\r'),(408,'TM81','The user slashes at the target by crossing its scythes or claws as if they were a pair of scissors.\r'),(409,'TM82','\"The target is knocked away'),(410,'TM83','The target is infested and attacked for four to five turns. The target can’t flee during this time.\r'),(411,'TM84